import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
	faBolt,
	faBuilding,
	faBatteryFull,
	faBatteryEmpty,
} from "@fortawesome/free-solid-svg-icons";

const GridBatteryBuildingSupply = ({ ...data }) => {
	let batteryIcon;
	let batteryColorClass;

	return (
    <div className="p-4 bg-gray-100 rounded-lg shadow-md flex items-center justify-center">
      <div className="bg-gray-200 w-60">
        <div className="flex items-center justify-center rounded-full bg-slate-400 w-24 h-24">
          <FontAwesomeIcon icon={faBolt} className="text-blue-500 text-xl" />
        </div>
        <div className="mt-4 text-center">
          <p className="text-sm text-gray-600">Connected</p>
        </div>
      </div>
    </div>
	);
};

export default GridBatteryBuildingSupply;
